import React from 'react';
import ReactDOM from 'react-dom';
import './sentence.css';

class Sentence extends React.Component {
    render() {
    return (
      <div className="sentence row container-fluid">
        <h2 className="psen justify-content-center mx-auto d-block">מפגש של מסורת רבת שנים וקולינריה מודרנית סגנונית בצלחת שלך...האוכל שלנו הוא ביטוי של פריצת דרך כרמלית של המטעמים הדרוזים.</h2>
      </div>
    );
  }
}
export default Sentence
